עוד
נשקלו נסיבות ביצוע העבירות, ובכלל זה את ריבוי מקרי הברחות היהלומים – 29 במספרם;
את שווי היהלומים שהוברחו; את משך הזמן – למעלה משש שנים – שבמהלכו בוצעו העבירות;
את התכנון שקדם להן; את חלקו של המערער במעשים, אשר הבריח את היהלומים עבור אחרים;
וכן את אשר הניע את המערער לביצוע העבירות – בצע כסף, כפי שהעיד בעצמו.

תגובה מקדמית מטעם המשיב 2 בבג"ץ 5604/19 ובבג"ץ 6651/19
  והמשיבים  6-4 בבג"ץ 6651/19 מיום
  27.1.2021;
